import React from 'react'

// import link
import { Link } from 'react-router-dom'

// import components
import Header from '../Header-Footer/Header'
import Footer from '../Header-Footer/Footer'

// import images
import r1img from '../../assets/images/Right side picture.png'

const HomePage = () => {
  return (
    <>
    <Header />
    {/* Landing Page */}
      <section className='home w-full h-screen'>
        <div className="flex">
            <span>Know Your Mind <br/> Heal Your Heart</span>
            <p>Interact, Learn, and Assess your concerns</p>
            <Link><i class="ri-hand-heart-line"></i><button className=''>Find Mental Health Support today</button></Link>

            {/* image */}
            <div className="">
              <img className='w-screen' src={r1img} alt="" />  
            </div>

        </div>

      </section>
    <Footer />
    </>
  )
}

export default HomePage
